import './App.css';
import Clouds from './templates/clouds/Clouds';
import DriftingClouds from './templates/clouds/DriftingClouds';
import HeavyRain from './templates/rain/HeavyRain';
import MatrixRain from './templates/rain/MatrixRain';
import SideRain from './templates/rain/SideRain';

function App() {
let images = ['Alaska1.jpg','Greenland1.jpg','Greenland2.jpg','Greenland3.jpg','Greenlan4','Haida.jpeg','Iceland1.jpeg','Iceland2.jpeg','Iceland3.jpeg','Iceland4.jpeg','Iceland5.jpeg'];
let i=0;
  let url = `./resources/images/${images[i]}`;

  return (
    <div className="App">
      <SideRain url={url} />
    </div>
  );
}

export default App;
